import React from 'react';
import resumeimage from "../../assets/resumeimage.png";
import resume from "../../assets/resume.pdf";
import iconDownload from "../../assets/iconDownload.svg";

function Resume() {

    return(
        <div class="container">
            <div class="row p-3">
                <div class="col-lg-2">
                    <a href={resume} download='resume-Justin-Hanson'><img src={iconDownload} class="img-download" /></a> 
                </div>
                <div class="col-lg-10">
                    <p>
                        Please click the icon to download a pdf copy of my resume.  Thank you for visiting my site.
                    </p>
                </div>
            </div>
            <div class="row">

                <img src={resumeimage} class="img-resume"/>
                <img src={resumeimage} class="img-resume"/>
            </div>
        </div>
    )
}

export default Resume;
